    deleted: false
    name: AbaBrygg
    description: Interessegruppe for AbaBrygg
    contact_email: ''
    parent: 14
    logo: null
    type: interesse
    text: 'Hender det seg at du tar en pils? Er lommeboken ofte tom, kanskje på grunn
      av pils?

      Visste du at ved å brygge øl selv kan man enkelt produsere øl til 3-4 kroner
      flaska?

      Ikke bare er det koselig, besparende, og luktfritt (!) å brygge eget øl, men
      imotsetningtil vinbrygging trenger man ikke være supermann for at sluttresultatet
      smaker godt.


      abaBrygg er en liten gruppe som passer deg som har en lidenskap for øl, harlyst
      til å prøve noe nytt, eller bare trenger litt starthjelp med brygginga.

      '
